syntax = "proto2";

package v3.fingerprint.ip.v4.service.library;

message Message {
  optional string host = 1;
  optional string mask = 2;
  optional int32 version = 3 [default = 4];
  optional string service =  4;
  optional uint32 port = 5;
  optional string protocol = 6;
  optional string library_type = 7;
  optional string library_name = 8;
  optional string library_version = 9;
  optional string detail = 10;

}
